INSERT INTO public.exercises (id, name, des, level, image, metadata, topic, status, "createdAt", "createdBy", "updatedAt", "updatedBy") VALUES ('8639eb5e-4286-4a03-80a8-3a96ae6d0473', 'Phép cộng', 'Cộng 2 số A và B', 1, NULL, '[{"input": "5 5", "point": 5, "output": "10", "time": 1000}, {"input": "8 7", "point": 5, "output": "15", "time": 1500}]', '["C++"]', 'active', '2022-05-02 10:33:48.845567+00', NULL, '2022-05-02 10:33:48.845567+00', NULL);
INSERT INTO public.exercises (id, name, des, level, image, metadata, topic, status, "createdAt", "createdBy", "updatedAt", "updatedBy") VALUES ('c260acdf-5436-47e0-8dcc-c2f1767ff82d', 'Odd Divisor Count', 'Bạn được cho 2 số nguyên A,B. Bạn hãy đếm số lượng số trong [A,B] sao cho số đó có số lượng lẻ ước nguyên dương.  
Ví dụ:  
   Với A = 4, B = 4 thì ta có đáp án là 1 số thỏa điều kiện. 
   Giải thích: 4 có 3 ước là 1,2,4 nên thỏa điều kiện để bài. 
[Đầu vào/ Đầu ra]:  
    [Giới hạn thời gian]: 0.5s với C++, 3s với Java & C#, 4s với Python,Go,Js. 
    [Đầu vào]: Số tự nhiên a (1 ≤ a ≤ 1000). 
    [Đầu vào]: Số tự nhiên b (a ≤ b ≤ 1000). 
    [Đầu ra]: Số lượng số trong [a,b] sao cho số đó có số lượng lẻ ước nguyên dương.', 2, NULL, '[{"input": "4 4", "point": 2, "output": "1", "time": 1000}, {"input": "1 10", "point": 2, "output": "3", "time": 1500}, {"input": "5 15", "point": 2, "output": "1", "time": 2000}, {"input": "50 120", "point": 2, "output": "3", "time": 2500}, {"input": "45 130", "point": 2, "output": "5", "time": 3000}]', '["C++"]', 'active', '2022-04-25 14:33:30.481496+00', NULL, '2022-04-25 14:33:30.481496+00', NULL);
